import { styled } from "styled-components";

const SellDiv = styled.div`
  position: relative;
`;

const A = styled.a`
  display: flex;
  align-items: center;
  margin-left: 30px;
`;

const Img = styled.img`
  width: 23px;
  height: 24px;
  margin-right: 5px;
`;

const SBSell = () => {
  return (
    <SellDiv>
      <div className="SBSellDiv">
        <A>
          <Img
            src={
              "https://m.bunjang.co.kr/pc-static/resource/bcc7abb5d531bcf26033.png"
            }
          >
            판매하기
          </Img>
        </A>
        <a>
          <img src="https://m.bunjang.co.kr/pc-static/resource/bcc7abb5d531bcf26033.png"></img>
          판매하기
        </a>
      </div>
    </SellDiv>
  );
};

export const Das = SellDiv;
export default SBSell;
